import './App.css';
import { Canvas, useFrame, useThree } from '@react-three/fiber';
import React, { Suspense, useRef, useEffect } from "react";
import { Wormhole } from "./components/wormhole/wormhole";
import { Header } from './components/header/header';
import { Galaxy } from './components/galaxy/galaxy';
import { Cosmosapiens } from './components/NFT/cosmosapiens';
import { Html, useGLTF, OrbitControls } from '@react-three/drei';


function Dolly() {
  // This one makes the camera move in and out
  useFrame(({ clock, camera }) => {
    // camera.position.z = 20 + Math.sin(clock.getElapsedTime()) * 5
    // camera.position.y = 10 + Math.sin(clock.getElapsedTime()) * 5
    // camera.position.x = 10 + Math.sin(clock.getElapsedTime()) * 10
  })
  return null
}


const HTMLContent = () => {
  return(
        <group position={[0,3,0]}>
          <mesh position={[0,0,0]}>
          </mesh>
          <Html center>
            <div className='drei-container'>
              <h3>
                wormhole_78c
              </h3>
            </div>
          </Html>
        </group>
  );
};
 
function App() {
  return (
    <div className='screen'>
      <div className='canvas darkBg'>
        <div className='header'>
          <Header />
        </div>
        <Canvas colorManagement camera={{position:[0,1,6], fov: 120}} >
        <OrbitControls enableZoom={true} 
            enablePan={true} 
            enableRotate={true} 
            zoomSpeed={0.6} 
            panSpeed={0.5} />
          <Suspense fallback={null}>
            <HTMLContent />
            <Wormhole />
            
            <Dolly />
            <Galaxy />
          </Suspense>
        </Canvas>
      </div>
      <div className='main'>
        <Cosmosapiens />
      </div>
    </div>
  );
}

export default App;
